Dark Blue draait om een team van vier undercoveragenten dat zich dagelijks in levensgevaarlijke situaties
begeeft. Het hoofd van het team is Carter Shaw, een veteraan op het gebied van undercovermisdaad. Bijgestaan
door zijn team, Ty Curtis, Dean Bendis en Jaimie Allen, is het de taak van Shaw om te infiltreren in het
leven van de criminelen van de onderwereld en ervoor te zorgen dat niemand hun echte identiteit ontdekt.
